db.patients.aggregate([
    { $unwind: "$IMMUNIZATIONS" },
    { $match: { "IMMUNIZATIONS.DESCRIPTION": "Influenza  seasonal  injectable  preservative free" } },
    { $project: { _id: 0, patient_id: "$PATIENT_ID" } }
])

db.patients.aggregate([
    { $unwind: "$SUPPLIES" },
    { $match: { "SUPPLIES.DESCRIPTION": "Continuous positive airway pressure nasal oxygen cannula (physical object)" } },
    { $project: { _id: 0, code: "$SUPPLIES.CODE" } }
])

db.patients.aggregate([
    { $unwind: "$ENCOUNTERS" },
    { $unwind: "$ENCOUNTERS.MEDICATIONS" },
    { $match: {
        "ENCOUNTERS.MEDICATIONS.DESCRIPTION": "Simvastatin 10 MG Oral Tablet"
    }},
    { $group: {
        _id: "$ENCOUNTERS.MEDICATIONS.DESCRIPTION",
        total_medications: { $sum: 1 },
        success_medications: {
            $sum: {
                $cond: [
                    { $gt: ["$ENCOUNTERS.STOP", new Date()] },
                    1,
                    0
                ]
            }
        }
    }},
    { $project: {
        _id: 0,
        medication: "$_id",
        success_rate: { $divide: ["$success_medications", "$total_medications"] }
    }}
])

db.patients.aggregate([
