db.organizations.aggregate([
    {
        $match: {
            "ORGANIZATION_ID": "844a8cb2-4164-35b2-88b8-dffa2889a738"
        }
    },
    {
        $lookup: {
            from: "providers",
            localField: "ORGANIZATION_ID",
            foreignField: "ORGANIZATION_REF",
            as: "providers"
        }
    },
    {
        $unwind: "$providers"
    },
    {
        $project: {
            _id: 0,
            first: "$providers.NAME",
            last: ""
        }
    }
])

This query will return the name of the providers associated with the organization with the ID 844a8cb2-4164-35b2-88b8-dffa2889a738. Since the schema does not have a "last" name for the organization, I am using an empty string for the "last" field in the $project stage.

