db.organizations.aggregate([
    {
        $match: { "NAME": "SERENITY HILL NURSING CENTER" }
    },
    {
        $project: { _id: 0, ORGANIZATION_ID: 1 }
    },
    {
        $lookup: {
            from: "providers",
            localField: "ORGANIZATION_ID",
            foreignField: "ORGANIZATION_REF",
            as: "providers"
        }
    },
    {
        $unwind: "$providers"
    },
    {
        $project: { _id: 0, first: "$providers.NAME" }
    },
    {
        $group: { _id: { first: "$first" } }
    },
    {
        $project: { _id: 0, first: "$_id.first" }
    }
])

